  let handleSubmit = (e) => {
    e.preventDefault();
    console.log('submit');

  }

  return (
    <form className='popup__form' onSubmit={handleSubmit}>
      <label >E-mail:</label>
      <input type='email' className='popup__input' />
      <label >Password:</label>
      <input type='password' className='popup__input' minLength={8}/>
      <label >Confirm password:</label>
      <input type='password' className='popup__input' />
      <button className='button popup__btn-submit'>{buttonContent}</button>
    </form>
  )
}
